import React from 'react';
import classes from "./Login.module.css"
import LoginForm from "../../components/Login Components/LoginForm/LoginForm";
import {useNavigate} from "react-router-dom";


const Login = () => {
    const router = useNavigate();
    
    return (
        <section>
            <button className={classes.backButton} onClick={()=>router('..', { relative: "path" })}>Return</button>
            <div className={classes.formBox}>
                <h2>Login</h2>
                <LoginForm/>
                <div className={classes.register}>
                    {/*<p>Don't have a account <a href="/signup">Register</a></p>*/}
                    <p>Login with <a href="http://localhost:5000/api/users/auth/google/callback">Google</a></p>
                </div>
            </div>
        </section>
    );
};

export default Login;
